import React from "react";
import bgvid from "./images/cricket.mp4";

function Design() {
  return (
    <>
      <div className="vid">
        <video autoPlay loop muted>
          <source src={bgvid} type="video/mp4" />
        </video>
      </div>
    </>
  );
}

export default Design;
